import React from "react";
import classes from "../styles/HeaderBurger.module.css";
import Navigation from "./Navigation";
import logoWhite from "../img/logoW.png";
import IconBurger from "../img/x.png";
import { useDispatch } from "react-redux";
import { activeBorgerAction } from "../store/Burger";
import { NavLink } from "react-router-dom";

const HeaderBurger = () => {
  const dispatch = useDispatch();
  const activeBurger = () => {
    dispatch(activeBorgerAction(true));
  };
  const fun = () => {
    prompt("desasds");
  };
  return (
    <div>
      <div className={classes.main}>
        <div className={classes.content}>
          <div className={classes.wth}>
            <Navigation
              icon={logoWhite}
              iconBurger={IconBurger}
              func={activeBurger}
            ></Navigation>
          </div>
          <div className={classes.pages}>
            <div>
                <NavLink
                  onClick={() => {
                    fun();
                  }}
                  className={({ isActive }) => (isActive ? classes.active : "")}
                >
                  Ювелирные изделия
                </NavLink>
            </div>
            <div className={classes.act}>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
                style={{borderWidth: "45px"}}
              >
                часы
              </NavLink>
            </div>
            <div>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
              >
                бренды
              </NavLink>
            </div>
            <div>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
              >
                ароматы
              </NavLink>
            </div>
            <div className={classes.act}>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
              >
                изделия из кожи
              </NavLink>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HeaderBurger;
